import React, {FC} from "react";

type ButtonType = {
  value: string
  theme: 'dark' | 'light'
  id?: string
  disabled?: boolean
  onClick: (e: React.FormEvent<HTMLButtonElement>) => void
}

const Button: FC<ButtonType> = (props) => {
  console.log(props.disabled)
  return <button type="button" disabled={props.disabled} id={props.id} onClick={props.onClick}>{props.value}</button>

}

export default Button
